import React from 'react';
import { NavLink } from 'react-router-dom';

const Navmenu = () => (
  <div>
    <ul>
      <li>
          <NavLink to>Home</NavLink>
      </li>
      <li>About</li>
      <li>Portfolio</li>
      <li>Contact</li>
    </ul>
  </div>
);

export default Navmenu;
